import {useState} from 'react'
import { Cookies, useCookies } from 'react-cookie'
import {useNavigate} from 'react-router-dom'
import axios from 'axios'
import React from 'react'
import Nav from '../components/Nav'

const Onboarding = () => {

    const [cookies, setCookie, removeCookie] = useCookies(['user'])
    const [formData, setFormData] = useState({
        user_id: cookies.UserId,
        first_name: '',
        dob_day: '',
        dob_month: '',
        dob_year: '',
        show_gender: false,
        gender_identity: 'man',
        gender_interest: 'woman',
        email: '',
        about: '',
        matches: []
    });

    let navigate = useNavigate()

    const handleSubmit = async (e) => {
        e.preventDefault();
        console.log("submitted");
        try {
            const response = await axios.put(`http://localhost:8000/user`, {formData})
            const success = response.status === 201
            if (success) navigate ('/dashboard')
        }
        catch (error) {
            console.log(error)
        }
    }

    const handleChange = (e) => {
        console.log(e);
        const value = e.target.value === 'checkbox' ? e.target.checked : e.target.value;
        const name = e.target.name;
        console.log(name, value);

        setFormData((prev) => ({
            ...prev,
            [name]: value
        }));
    }
    console.log(formData);

    return (
        <>
            <Nav minimal={true}
                showModal={
                    () => {}
                }
                setShowModal={false}
                setIsSignup={false}/>
            <div className='onboarding'>
                <h2>CREATE ACCOUNT</h2>
                <form onSubmit={handleSubmit}>
                    <section>
                        <label htmlFor='first_name'>First Name</label>
                        <input type='text' id='first_name' name='first_name' placeholder='First Name'
                            required={true}
                            value={
                                formData.first_name
                            }
                            onChange={handleChange}/>

                        <label htmlFor='dob_day'>Birthday</label>
                        <div className='multiple_input_container'>
                            <input type='number' id='dob_day' name='dob_day' placeholder='DD'
                                required={true}
                                value={
                                    formData.dob_day
                                }
                                onChange={handleChange}/>

                            <input type='number' id='dob_month' name='dob_month' placeholder='MM'
                                required={true}
                                value={
                                    formData.dob_month
                                }
                                onChange={handleChange}/>

                            <input type='number' id='dob_year' name='dob_year' placeholder='YYYY'
                                required={true}
                                value={
                                    formData.dob_year
                                }
                                onChange={handleChange}/>
                        </div>
                        <label>Gender</label>
                        <div className='multiple_input_container'>
                            <input type='radio' id='man_gender_identity' name='gender_identity' value='man'
                                onChange={handleChange}
                                checked={
                                    formData.gender_identity === 'man'
                                }/>
                            <label htmlFor='man_gender_identity'>Man</label>
                            <input type='radio' id='woman_gender_identity' name='gender_identity' value='woman'
                                onChange={handleChange}
                                checked={
                                    formData.gender_identity === 'woman'
                                }/>
                            <label htmlFor='woman_gender_identity'>Woman</label>
                            <input type='radio' id='more_gender_identity' name='gender_identity' value='more'
                                onChange={handleChange}
                                checked={
                                    formData.gender_identity === 'more'
                                }/>
                            <label htmlFor='more_gender_identity'>More</label>
                        </div>
                        <label htmlFor='show-gender'>Show gender on my profile</label>
                        <input type='checkbox' id='show_gender' name='show_gender'
                            onChange={handleChange}
                            checked={
                                formData.show_gender
                            }/>

                        <label>Show Me</label>

                        <div className="multiple_input_container">
                            <input id="man-gender-interest" type="radio" name="gender_interest" value="man"
                                onChange={handleChange}
                                checked={
                                    formData.gender_interest === "man"
                                }/>
                            <label htmlFor="man-gender-interest">Man</label>
                            <input id="woman-gender-interest" type="radio" name="gender_interest" value="woman"
                                onChange={handleChange}
                                checked={
                                    formData.gender_interest === "woman"
                                }/>
                            <label htmlFor="woman-gender-interest">Woman</label>
                            <input id="everyone-gender-interest" type="radio" name="gender_interest" value="everyone"
                                onChange={handleChange}
                                checked={
                                    formData.gender_interest === "everyone"
                                }/>
                            <label htmlFor="everyone-gender-interest">Everyone</label>

                        </div>


                        <label htmlFor='about'>About Me</label>
                        <input type='text' id='about' name='about' placeholder='About Me'
                            required={true}
                            value={
                                formData.about
                            }
                            onChange={handleChange}/>
                        <input type='submit' value='Submit'/>
                    </section>
                    <section>
                        <label htmlFor='about'>Profile Picture</label>
                        <input type="url" name="url" id="url"
                            onChange={handleChange}
                            required={true}></input>
                        <div className='photo_container'>
                            {formData.url && <img src={
                                    formData.url
                                }
                                alt="profile pic"/>}
                        </div>
                    </section>
                </form>
            </div>
        </>
    )
}

export default Onboarding
